import React from "react";

type props = {
  value: any;
  onChange: (e: React.ChangeEvent<HTMLInputElement>) => {};
  stateChange: any;
};

export const Textfield: React.FC<props> = (
  { value, onChange, stateChange },
  attributes
) => {
  return (
    <input
      value={value}
      onChange={(event) => onChange(event)}
      {...attributes}
      className="form-control"
      type="number"
      step="0.1"
      min="0"
    />
  );
};
